uint32_t rev(uint32_t k, int m) {
    uint32_t r = 0;
    for (int i = 0; i < m+1; i++) {
        r = (r << 1) | ((k >> i) & 1);
    }
    return r;
}

void print_vector(vector<uint8_t> v) {
    for (uint32_t i = 0; i < v.size(); i++) {
        printf("%d ", v[i]);
    }
    printf("\n");
}

